import React from 'react';
import {useHistory} from 'react-router-dom';

const Sidebar = () => {
  let history = useHistory();

  const handleProfile = () => {
    history.push('/profile');
  };
  const handleSkill = () => {
    history.push('/skill');
  };
  const handleProject = () => {
    history.push('/project');
  };
  const handleReport = () => {
    history.push('/report');
  };
  return (
    <nav id="sidebar">
      <div class="sidebar-header"></div>

      <ul class="list-unstyled components">
        <li class="active">
          <a href="#homeSubmenu" data-toggle="collapse" aria-expanded="false">
            <i class="fa fa-product-hunt" onClick={handleProfile}></i> My
            Profile
          </a>
        </li>

        <li>
          <a href="#pageSubmenu" data-toggle="collapse" aria-expanded="false">
            <i class="fa fa-calendar" onClick={handleSkill}></i> My Skills
          </a>
        </li>
        <li>
          <a href="#">
            <i class="fa fa-th-large" onClick={handleProject}></i> My Projects
          </a>
        </li>
        <li>
          <a href="#">
            <i class="fa fa-files-o" onClick={handleReport}></i> My Report
          </a>
        </li>
      </ul>
    </nav>
  );
};

export default Sidebar;
